import Header from "./components/Header";
import Posts from "./components/Posts";
import Footer from "./components/Footer";
import Form from "./components/Form";
import { useState } from "react";
import uuid from "react-uuid";

export default function App() {
  const [posts, setPosts] = useState([
    {
      id: uuid(),
      title: 'Hoppip!',
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum diam risus, eleifend eget suscipit a, finibus sed dui.",
      category: 'ent',
      promote: true,
      status: 'p',
      picture: "data:image/png;base64,",
      likes: 0,
      dislikes: 0,
    },
    {
      id: uuid(),
      title: 'Bobasor???',
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum diam risus, eleifend eget suscipit a, finibus sed dui. Sed urna massa, suscipit non mauris eget, faucibus vehicula mi. Proin ultricies efficitur maximus.",
      category: "edu",
      promote: false,
      status: 'p',
      picture: "data:image/png;base64,",
      likes: 0,
      dislikes: 0
    },
    {
      id: uuid(),
      title: 'Meadow Cat',
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum diam risus, eleifend eget suscipit a, finibus sed dui. Sed urna massa, suscipit non mauris eget, faucibus vehicula mi. Proin ultricies efficitur maximus.",
      category: "ent",
      promote: false,
      status: 'p',
      picture: "data:image/jpeg;base64,",
      likes: 0,
      dislikes: 0
    },

  ]);

  const handleNewPost = (
    title,
    description,
    category,
    promote,
    status,
    picture
  ) => {
    const updatedPosts = [...posts];
    updatedPosts.push({
      id: uuid(),
      title: title,
      description,
      category,
      promote,
      status,
      picture,
      likes: 0,
      dislikes: 0,
    });
    setPosts(updatedPosts);
  };

  const handleLike = (id) => {
    const updatedPosts = [...posts];
    updatedPosts.forEach((post) => {
      if (post.id === id) {
        post.likes++;
      }
    });
    setPosts(updatedPosts);
  };

  const handleDislike = (id) => {
    const updatedPosts = [...posts];
    updatedPosts.forEach((post) => {
      if (post.id === id) {
        post.dislikes++;
      }
    });
    setPosts(updatedPosts);
  };

  return (
    <>
      <Header />
      <Posts posts={posts} onLike={handleLike} onDislike={handleDislike} />
      <Form onNewPost={handleNewPost} />
      <Footer />
    </>
  );
}
